class Solution {
    fun countSubMultisets(nums: List<Int>, l: Int, r: Int): Int {
        val mod = 1_000_000_007
        val sum = nums.sum()
        val dp = Array(nums.size + 1) { LongArray(sum + 1) }
        dp[0][0] = 1L
        for (i in 1..nums.size) {
            val num = nums[i - 1]
            for (j in 0..sum) {
                dp[i][j] = dp[i - 1][j]
                if (j >= num) dp[i][j] = (dp[i][j] + dp[i - 1][j - num]) % mod
            }
        }
        var count = 0L
        for (s in l..r) {
            for (i in 1..nums.size) {
                count = (count + dp[i][s]) % mod
            }
        }
        return count.toInt()
    }
}
